var title_f20_43_21180="Sinoatrial conduction time";
var content_f20_43_21180=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71074&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71074&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Indirect determination of the sinoatrial conduction time",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 390px; height: 202px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Calculation of the sinoatrial conduction time requires defining a zone of resetting. Panel A demonstrates a stable sinus or atrial-paced rhythm representing the basal A1-A1 interval. Panel B shows the introduction of a premature atrial extrastimuli (A2) that enters and depolarizes sinoatrial tissue restarting the next sinus interval from that point (resetting of the sinus node). A3 is the first spontaneous sinus beat that occurs after termination of the pacing sequence providing the return cycle (A2-A3). This zone of resetting is defined over a range of A1-A2 intervals where the A2-A3 exceeds the A1-A1, but the sum of A1-A2 and A2-A3 must be less than the twice the A1-A1 (ie, less than compensatory).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Joseph J Germano, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
